import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { FormsModule } from '@angular/forms';

import { AppComponent } from './app.component';
import { HeaderComponent } from './module-client/header/header.component';
import { HomeComponent } from './module-client/home/home.component';
import { AppRoutingModule } from './app-routing.module';
import { SearchComponent } from './search/search.component';
import localeFr from '@angular/common/locales/fr'
import { registerLocaleData } from '@angular/common';
import { CartComponent } from './module-client/cart/cart.component';
import { FoodDetailComponent } from './module-client/food-detail/food-detail.component';
import { CommandComponent } from './module-client/command/command.component';
import { ClientComponent } from './module-client/client/client.component';
import { AdminComponent } from './module-admin/admin/admin.component';
import { LoginComponent } from './module-admin/login/login.component';
import { CommandsComponent } from './module-admin/commands/commands.component';
import { NewFoodComponent } from './module-admin/new-food/new-food.component';
import { EditFoodComponent } from './module-admin/edit-food/edit-food.component';
import { ModuleAdminModule } from './module-admin.module';

registerLocaleData(localeFr, 'fr')

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    HomeComponent,
    SearchComponent,
    CartComponent,
    FoodDetailComponent,
    CommandComponent,
    ClientComponent,
    AdminComponent,
    LoginComponent,
    CommandsComponent,
    NewFoodComponent,
    EditFoodComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    ModuleAdminModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
